import React from "react";
import NoticeCategoryItem from "modules/NoticeCategoryItem/NoticeCategoryItem";
import styles from "./notices-category-list.module.css"
import { noticies } from "./notices";
import { Container, containerClasses } from "../../css/utils/";

//let  = noticies.map((notice) => notice.id )
const NoticesCategoryList = ({ petInformation }) => {
  return (
    <ul className={styles.petsListWrapper}>

        {noticies.map(
            ({
              _id,
              avatarURL,
              title,
              petName,
              breed,
              location,
              dateOfBirth,
              price,
              category,
              favorite,
              owner,
            }) => (
              <NoticeCategoryItem
                key={_id}
                image={avatarURL}
                title={title}
                petName={petName}
                breed={breed}
                place={location}
                dateOfBirth={dateOfBirth}
                price={price}
                category={category}
                favorite={favorite}
                owner={owner}

              />
            )
          )}

    </ul>
  );
};


export default NoticesCategoryList
